description:
Verenigde Staten
Horror
97 minuten

een goeie film

met Sarah Butler, Daniel Franzese en Chad Lindberg

Een schrijfster trekt zich voor haar nieuwste boek terug in een verlaten huisje in de bossen. Hier wordt ze op brute wijze 
overvallen en verkracht en voor dood achtergelaten. Weer bijgekomen besluit ze om wraak te nemen op de personen die haar hebben 
aangevallen. En voor deze wraak gaat ze niets uit de weg.
